import math
from typing import List

def find_smallest_divisor(nums: List[int], threshold: int) -> int:

    def calculate_sum(divisor: int) -> int:
        return sum((math.ceil(num / divisor) for num in nums))
    (low, high) = (1, max(nums))
    while low <= high:
        mid = (low + high) // 2
        if calculate_sum(mid) > threshold:
            low = mid + 1
        else:
            high = mid
    return low

